function enc($v,$enc){
	$fn = [];
	$f = "out.txt";
	$fout = $dout = $eout = null;
	$enl = 16;
	if(file_exists($v)){
		$lf = str_replace(["\n","\r"],"",file_get_contents($f));
		if(strlen($lf) % $enl == 0){
			$se = str_split($lf,$enl);
			for($l=0; $l<=count($se)-1; $l++){
				if(strlen($se[$l]) == $enl){
					foreach($enc as $enck => $encv){
						if(in_array($se[$l],$enc[$enck])){
							$dout .= $enck;
						}
					}
				}else{
					print "\nfailed decrypting (error code 0x$l)\n";
				}
			}
			if(strlen($lf) > 100){
				$eout = substr($lf,0,100)."...";
			}else{
				$eout = $lf;
			}
			print "input       : $eout\ndecrypted   : $dout\n\n";
		}else{
			print "not a valid encrypted code\n\n";
		}
	}else{
		$vs = str_split($v);
		for($i=0; $i<=count($vs)-1; $i++){
			$fn[] = $enc[$vs[$i]][rand(0,255)];
		}
		print "input       : $v\nencrypted   : ";
		for($j=0; $j<=count($fn)-1; $j++){
			$fout .= $fn[$j];
		}
		file_put_contents($f,$fout);
		if(strlen($fout) > 100){
			$eout = substr($fout,0,100)."...";
		}else{
			$eout = $fout;
		}
		print "$eout\noutput file : $f\n\n";
	}
}

if(isset($argv[1])){
	enc($argv[1],$enc);
}else{
	print "usage php {$argv[0]} string\n\n";
}
